import React from 'react';

const Resources = () => {
  return (
    <div className="resources">
      <h2>Recommended Resources</h2>
      <div className="resource-item">
        <h3>Learning Video on Module 1</h3>
        <p>A comprehensive video to help you with Module 1</p>
      </div>
      <div className="resource-item">
        <h3>Practice Quiz on Module 1</h3>
        <p>Test your knowledge with this quiz.</p>
      </div>
      <div className="resource-item">
        <h3>Reading Material: Introduction to Topic</h3>
        <p>A reading material to give you more context on the subject.</p>
      </div>
    </div>
  );
};

export default Resources;
